App.prototype.reloadServerDetail = function() {
	var _self = this;
	_self.visionApi.getFTPServerList({
		orgid : _self.appCache.settingInfo.org_id
	}, function(result) {
		for (var i = 0; i < result.ftpservers.length; i++) {
			findCount = 0
			ftpItem = result.ftpservers[i];
			findCount = jQuery.grep(_self.appCache.ftpServers, function(item,
					index) {
				return item.name == ftpItem.name;
			});
			if (!findCount.length > 0) {
				_self.appCache.ftpServers.push(ftpItem);
			}
		}
		_self.appDB.createFTPEntry();
	}, function(msg) {
		_self.showError("pg_menu", "Servers failed : " + msg);
	});
}

App.prototype.onUpdateWaterMark = function(value, error) {
	var _self = this;
	_self.visSettingsDAO.updateWaterMark(value, function(result) {
		if (result.rowsAffected)
			if (result.rowsAffected > 0) {
				var settingInfo = _self.appCache.settingInfo;
				settingInfo['watermark'] = value;
				_self.appCache.updateSettingInfo(settingInfo);
			}
	}, error);
}

String.prototype.endsWith = function(s) {
	return this.length >= s.length && this.substr(this.length - s.length) == s;
}

if (typeof String.prototype.startsWith != 'function') {
	String.prototype.startsWith = function(str) {
		return this.slice(0, str.length) == str;
	};
}

App.prototype.logout = function() {
	var _self = this;
	_self.appCache.reset();
	var visSettingsDAO = new Tbl_VISSetting(this);
	visSettingsDAO.login("N", function(data) {
		console.log("DB-Logout Success!")
	}, function(msg) {
		console.log("DB-Logout Failed!")
	});
	$.mobile.changePage("#pg_login");
}

App.prototype.onBackButton = function() {
	var _self = this;
	if (_self.appCache.currentPage == '#pg_login') {
		$.mobile.changePage("#pg_home");
	} else if (_self.appCache.currentPage == '#pg_home') {
		function checkButtonSelection(iValue) {
			if (iValue == 2) {
				navigator.app.exitApp();
			}
		}
		navigator.notification.confirm("Are you sure you want to EXIT ?",
				checkButtonSelection, 'EXIT APP:', [ 'Cancel', 'OK' ]);
	} else if (_self.appCache.currentPage == '#pg_menu') {
		$.mobile.changePage("#pg_home");
	} else if (_self.appCache.currentPage == '#pg_inspection') {
		$.mobile.changePage("#pg_menu");
	} else if (_self.appCache.currentPage == '#pg_inspection_detail') {
		$.mobile.changePage("#pg_inspection");
	} else if (_self.appCache.currentPage == '#pop_process_log') {
		$.mobile.changePage("#pg_inspection");
	} else if (_self.appCache.currentPage == '#pg_gallery') {
		$.mobile.changePage("#pg_inspection_detail");
	} else if (_self.appCache.currentPage == '#pg_file_explorer') {
		$.mobile.changePage("#pg_gallery");
	} else if (_self.appCache.currentPage == '#server-setting') {
		$.mobile.changePage("#pg_login");
	} else {
		navigator.app.backHistory();
	}
}

